commits.content:
footer {
  background-color: #333;
  color: #fff;
  padding: 20px 0;
  text-align: center;
}

.footer-container {
  display: flex;
  justify-content: space-around;
  flex-wrap: wrap;
  max-width: 1200px;
  margin: auto;
  padding: 10px;
}

.footer-section {
  margin: 10px;
}

.footer-section h4 {
  font-size: 18px;
  margin-bottom: 10px;
}

.footer-section ul {
  list-style: none;
  padding: 0;
}

.footer-section ul li {
  margin-bottom: 8px;
}

.footer-section ul li a {
  color: #fff;
  text-decoration: none;
  transition: 0.3s;
}

.footer-section ul li a:hover {
  color: #f4b400;
}

.social-icons {
  display: flex;
  gap: 15px;
  justify-content: center;
}

.social-icons a {
  color: #fff;
  font-size: 20px;
  transition: 0.3s;
}

.social-icons a:hover {
  color: #f4b400;
}

.footer-bottom {
  margin-top: 20px;
  font-size: 14px;
}
